function baceo(e){var i=document.querySelector("body");i.innerHTML='<video autoplay loop class="baceo-vid" muted plays-inline><source src='+e.path+" type=video/"+e.type+"></video>"+i.innerHTML,document.querySelector(".baceo-vid").style="position:fixed; right:0; top:0; min-width:100%; min-height:100%; width:auto; height:auto; z-index:-1"}